import 'dart:convert';
import 'dart:developer';
import 'package:http/http.dart';
import 'package:flutter/material.dart';
import 'package:task_manager_flutter/app.dart';
import 'package:task_manager_flutter/data/models/auth_utility.dart';
import 'package:task_manager_flutter/data/models/network_response.dart';
import 'package:task_manager_flutter/ui/screens/auth_screens/login_screen.dart';

class CotacaoCaller {
  Future<List<CotacaoDTO>> fetchCotacoes() async {
  final response = await http.get(Uri.parse('https://suaapi.com/api/cotacoes'));

  if (response.statusCode == 200) {
    final List<dynamic> jsonData = json.decode(response.body);
    return jsonData.map((json) => CotacaoDTO.fromJson(json)).toList();
  } else {
    throw Exception('Falha ao carregar cotações');
  }
}
}
